import { reduxForm, Field } from 'redux-form';

const Year = props => {
    return (
        <div>
            <Field
                type="number"
                name="year"
                value={props.year}
                component="input"
                maxLength="17"
                onChange={props.handleChange}
                placeholder="Enter 4 digit Year" />
        </div>
    )
}

export default reduxForm({
    form: 'car'
})(Year)

